    flexDirection: 'row',

  },
  input:{
    
    width: '85%',
    borderColor: 'white',
    borderWidth: 2,
    borderRadius: 10,


  },
  text:{
    color: 'white',
    alignItems: 'center'
  },
  button:{
    position: 'absolute',
